const Nav = ({onSearch}) => {

  return(
    
    <nav className = {style.containerNav}>
        <SearchBar onSearch={onSearch} className = {style.containerSearch}/>
        <ul className = {style.unorderList}>
          <li>About Us</li>
          <li>Contact Galaxy</li>
          <li>Rick & Morty</li>
          <li>Llamanos</li>
        </ul>
    </nav> 
  );

}

export default Nav;
